// Solution 2:
const moveElementToEnd = (array, toMove) => {
    let left = 0;
    for (let right = 0; right < array.length; right++) {
        if (array[right]!== toMove) {
            [array[left], array[right]] = [array[right], array[left]];
            left++;
        }
    }

    return array;
};

